import React from "react";
import ColorSliderProvider, { HueSlider } from "material-ui-color-sliders";

export default () => {
  return (
    <ColorSliderProvider value={{ color, setColor }}>
      <HueSlider style={{ margin: "128px", width: "calc(100% - 256px)" }} />
    </ColorSliderProvider>
  );
};
